import React,{useState, useEffect} from 'react'
import News from './News'

export default function NewsContainer() {
    const[news, setNews]= useState([])

    useEffect(() => {
        fetch('http://www.boredapi.com/api/activity/')
        .then(response => response.json())
        .then(setNews)
    },[])



  return (
    <News 
    news={news} />
    )



}
